contracts/OrderNFTCollection.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/security/Pausable.sol";
import "@openzeppelin/contracts/utils/Counters.sol";

interface IOrderNFTLaunch {
    function updateMintedCount(uint256 _newMintedCount) external;
}

/**
 * @title OrderNFTCollection
 * @notice Individual NFT collection contract created by the factory
 * @dev Supports custom ERC20 tokens for minting with marketplace functionality
 * @dev Security: ReentrancyGuard for reentrancy protection, SafeERC20 for token transfers
 */
contract OrderNFTCollection is ERC721, ReentrancyGuard, Pausable {
    using SafeERC20 for IERC20;
    using Counters for Counters.Counter;
    
    // Collection parameters
    string private baseTokenURI;
    uint256 public maxSupply;
    address public mintToken; // ERC20 token for minting
    uint256 public mintPrice; // Price per NFT in mintToken
    uint256 public marketplaceFeePercent; // Fee percentage (basis points, max 1000 = 10%)
    
    // Collection management
    address public creator;
    address public factory;
    Counters.Counter private _tokenIdCounter;
    
    // Marketplace functionality
    struct Listing {
        uint256 tokenId;
        address seller;
        uint256 price;
        address paymentToken;
        uint256 listedAt;
        bool active;
    }
    
    mapping(uint256 => Listing) public listings;
    mapping(uint256 => bool) public isListed;
    uint256[] public activeListings;
    mapping(uint256 => uint256) private listingIndex; // tokenId => index in activeListings
    
    // Revenue tracking
    uint256 public totalRevenue;
    uint256 public totalMarketplaceFees;
    mapping(address => uint256) public revenueByToken;
    mapping(address => uint256) public marketplaceFeesByToken;
    
    // Collection metadata
    string public description;
    string public collectionImageUrl;
    
    // Events
    event TokenMinted(address indexed to, uint256 indexed tokenId, uint256 price, address paymentToken);
    event TokenListed(uint256 indexed tokenId, address indexed seller, uint256 price, address paymentToken);
    event TokenUnlisted(uint256 indexed tokenId, address indexed seller);
    event TokenSold(uint256 indexed tokenId, address indexed seller, address indexed buyer, uint256 price, address paymentToken, uint256 marketplaceFee);
    event PriceUpdated(uint256 indexed tokenId, uint256 oldPrice, uint256 newPrice);
    event RevenueWithdrawn(address indexed creator, uint256 amount, address token);
    event MarketplaceFeeWithdrawn(address indexed creator, uint256 amount, address token);
    event MintPriceUpdated(uint256 oldPrice, uint256 newPrice);
    event MarketplaceFeeUpdated(uint256 oldFee, uint256 newFee);
    event ERC20Recovered(address indexed token, address indexed to, uint256 amount);
    
    modifier onlyCreator() {
        require(msg.sender == creator, "Only creator");
        _;
    }
    
    modifier onlyTokenOwner(uint256 _tokenId) {
        require(ownerOf(_tokenId) == msg.sender, "Not token owner");
        _;
    }
    
    modifier validTokenId(uint256 _tokenId) {
        require(_exists(_tokenId), "Token does not exist");
        _;
    }
    
    modifier notListed(uint256 _tokenId) {
        require(!isListed[_tokenId], "Token is listed");
        _;
    }
    
    modifier isListedToken(uint256 _tokenId) {
        require(isListed[_tokenId], "Token not listed");
        _;
    }
    
    constructor(
        string memory _name,
        string memory _symbol,
        string memory _baseTokenURI,
        uint256 _maxSupply,
        address _mintToken,
        uint256 _mintPrice,
        uint256 _marketplaceFeePercent,
        address _creator,
        address _factory
    ) ERC721(_name, _symbol) {
        require(bytes(_name).length > 0, "Name required");
        require(bytes(_symbol).length > 0, "Symbol required");
        require(bytes(_baseTokenURI).length > 0, "Base URI required");
        require(_maxSupply > 0, "Max supply must be positive");
        require(_mintToken != address(0), "Invalid mint token");
        require(_mintPrice > 0, "Mint price must be positive");
        require(_marketplaceFeePercent <= 1000, "Fee too high"); // Max 10%
        require(_creator != address(0), "Invalid creator");
        require(_factory != address(0), "Invalid factory");
        
        baseTokenURI = _baseTokenURI;
        maxSupply = _maxSupply;
        mintToken = _mintToken;
        mintPrice = _mintPrice;
        marketplaceFeePercent = _marketplaceFeePercent;
        creator = _creator;
        factory = _factory;
        
        // Start token IDs from 1
        _tokenIdCounter.increment();
    }
    
    /**
     * @notice Pause contract functions
     * @dev Only creator can pause
     */
    function pause() external onlyCreator {
        _pause();
    }
    
    /**
     * @notice Unpause contract functions
     * @dev Only creator can unpause
     */
    function unpause() external onlyCreator {
        _unpause();
    }
    
    /**
     * @notice Set collection metadata
     * @param _description Collection description
     * @param _collectionImageUrl Collection image URL
     */
    function setMetadata(string calldata _description, string calldata _collectionImageUrl) external onlyCreator {
        description = _description;
        collectionImageUrl = _collectionImageUrl;
    }
    
    /**
     * @notice Update mint price
     * @param _newPrice New mint price
     */
    function setMintPrice(uint256 _newPrice) external onlyCreator {
        require(_newPrice > 0, "Price must be positive");
        uint256 oldPrice = mintPrice;
        mintPrice = _newPrice;
        emit MintPriceUpdated(oldPrice, _newPrice);
    }
    
    /**
     * @notice Update marketplace fee percentage
     * @param _newFeePercent New fee percentage (max 1000 = 10%)
     */
    function setMarketplaceFee(uint256 _newFeePercent) external onlyCreator {
        require(_newFeePercent <= 1000, "Fee too high");
        uint256 oldFee = marketplaceFeePercent;
        marketplaceFeePercent = _newFeePercent;
        emit MarketplaceFeeUpdated(oldFee, _newFeePercent);
    }
    
    /**
     * @notice Mint new NFT
     * @param _to Address to receive the NFT
     */
    function mint(address _to) external nonReentrant whenNotPaused returns (uint256) {
        require(_to != address(0), "Invalid recipient");
        require(_tokenIdCounter.current() <= maxSupply, "Max supply reached");
        
        uint256 tokenId = _tokenIdCounter.current();
        
        // Transfer payment from sender to contract first (to handle fee-on-transfer tokens)
        uint256 balanceBefore = IERC20(mintToken).balanceOf(address(this));
        IERC20(mintToken).safeTransferFrom(msg.sender, address(this), mintPrice);
        uint256 balanceAfter = IERC20(mintToken).balanceOf(address(this));
        uint256 actualReceived = balanceAfter - balanceBefore;
        
        // Mint the NFT
        _safeMint(_to, tokenId);
        _tokenIdCounter.increment();
        
        // Update revenue tracking with actual received amount
        totalRevenue += actualReceived;
        revenueByToken[mintToken] += actualReceived;
        
        // Update factory minted count
        IOrderNFTLaunch(factory).updateMintedCount(_tokenIdCounter.current() - 1);
        
        emit TokenMinted(_to, tokenId, actualReceived, mintToken);
        
        return tokenId;
    }
    
    /**
     * @notice List NFT for sale
     * @param _tokenId Token ID to list
     * @param _price Sale price
     * @param _paymentToken Token to accept as payment
     */
    function listToken(uint256 _tokenId, uint256 _price, address _paymentToken) external nonReentrant whenNotPaused validTokenId(_tokenId) onlyTokenOwner(_tokenId) notListed(_tokenId) {
        require(_price > 0, "Price must be positive");
        require(_paymentToken != address(0), "Invalid payment token");
        
        // Verify payment token is valid ERC20
        try IERC20(_paymentToken).totalSupply() returns (uint256) {
            // Token is valid
        } catch {
            revert("Invalid ERC20 payment token");
        }
        
        listings[_tokenId] = Listing({
            tokenId: _tokenId,
            seller: msg.sender,
            price: _price,
            paymentToken: _paymentToken,
            listedAt: block.timestamp,
            active: true
        });
        
        isListed[_tokenId] = true;
        listingIndex[_tokenId] = activeListings.length;
        activeListings.push(_tokenId);
        
        emit TokenListed(_tokenId, msg.sender, _price, _paymentToken);
    }
    
    /**
     * @notice Unlist NFT from sale
     * @param _tokenId Token ID to unlist
     */
    function unlistToken(uint256 _tokenId) external validTokenId(_tokenId) onlyTokenOwner(_tokenId) isListedToken(_tokenId) {
        _removeListing(_tokenId);
        emit TokenUnlisted(_tokenId, msg.sender);
    }
    
    /**
     * @notice Update listing price
     * @param _tokenId Token ID
     * @param _newPrice New price
     */
    function updatePrice(uint256 _tokenId, uint256 _newPrice) external validTokenId(_tokenId) onlyTokenOwner(_tokenId) isListedToken(_tokenId) {
        require(_newPrice > 0, "Price must be positive");
        uint256 oldPrice = listings[_tokenId].price;
        listings[_tokenId].price = _newPrice;
        emit PriceUpdated(_tokenId, oldPrice, _newPrice);
    }
    
    /**
     * @notice Buy listed NFT
     * @param _tokenId Token ID to buy
     */
    function buyToken(uint256 _tokenId) external nonReentrant whenNotPaused validTokenId(_tokenId) isListedToken(_tokenId) {
        Listing memory listing = listings[_tokenId];
        require(listing.active, "Listing not active");
        require(msg.sender != listing.seller, "Cannot buy own token");
        
        address seller = listing.seller;
        uint256 price = listing.price;
        address paymentToken = listing.paymentToken;
        
        // Remove listing before transfers (prevent reentrancy)
        _removeListing(_tokenId);
        
        // Transfer full payment from buyer to contract first (to handle fee-on-transfer tokens)
        uint256 balanceBefore = IERC20(paymentToken).balanceOf(address(this));
        IERC20(paymentToken).safeTransferFrom(msg.sender, address(this), price);
        uint256 balanceAfter = IERC20(paymentToken).balanceOf(address(this));
        uint256 actualReceived = balanceAfter - balanceBefore;
        
        // Recalculate amounts based on actual received
        uint256 actualMarketplaceFee = (actualReceived * marketplaceFeePercent) / 10000;
        uint256 actualSellerAmount = actualReceived - actualMarketplaceFee;
        
        // Transfer payments from contract
        if (actualSellerAmount > 0) {
            IERC20(paymentToken).safeTransfer(seller, actualSellerAmount);
        }
        if (actualMarketplaceFee > 0) {
            // Keep marketplace fee in contract for withdrawal
            totalMarketplaceFees += actualMarketplaceFee;
            marketplaceFeesByToken[paymentToken] += actualMarketplaceFee;
        }
        
        // Transfer NFT
        _transfer(seller, msg.sender, _tokenId);
        
        emit TokenSold(_tokenId, seller, msg.sender, actualReceived, paymentToken, actualMarketplaceFee);
    }
    
    /**
     * @notice Creator withdraws accumulated revenue
     * @param _token Token address to withdraw
     * @param _amount Amount to withdraw
     */
    function withdrawRevenue(address _token, uint256 _amount) external onlyCreator nonReentrant {
        require(_token != address(0), "Invalid token address");
        require(_amount > 0, "Amount must be positive");
        require(revenueByToken[_token] >= _amount, "Insufficient revenue");
        
        revenueByToken[_token] -= _amount;
        totalRevenue -= _amount;
        
        IERC20(_token).safeTransfer(creator, _amount);
        
        emit RevenueWithdrawn(creator, _amount, _token);
    }
    
    /**
     * @notice Creator withdraws accumulated marketplace fees
     * @param _token Token address to withdraw
     * @param _amount Amount to withdraw
     */
    function withdrawMarketplaceFees(address _token, uint256 _amount) external onlyCreator nonReentrant {
        require(_token != address(0), "Invalid token address");
        require(_amount > 0, "Amount must be positive");
        require(marketplaceFeesByToken[_token] >= _amount, "Insufficient fees");
        
        marketplaceFeesByToken[_token] -= _amount;
        totalMarketplaceFees -= _amount;
        
        IERC20(_token).safeTransfer(creator, _amount);
        
        emit MarketplaceFeeWithdrawn(creator, _amount, _token);
    }
    
    /**
     * @notice Emergency function to recover accidentally sent ERC20 tokens
     * @param _token Token address to recover
     * @param _to Address to send recovered tokens
     * @param _amount Amount to recover
     */
    function recoverERC20(address _token, address _to, uint256 _amount) external onlyCreator nonReentrant {
        require(_token != address(0), "Invalid token address");
        require(_to != address(0), "Invalid recipient address");
        require(_amount > 0, "Amount must be positive");
        
        // Cannot recover tracked revenue or marketplace fees
        uint256 protectedAmount = revenueByToken[_token] + marketplaceFeesByToken[_token];
        uint256 availableBalance = IERC20(_token).balanceOf(address(this));
        require(availableBalance >= protectedAmount + _amount, "Cannot recover protected funds");
        
        IERC20(_token).safeTransfer(_to, _amount);
        
        emit ERC20Recovered(_token, _to, _amount);
    }
    
    /**
     * @notice Get current total supply
     */
    function totalSupply() external view returns (uint256) {
        return _tokenIdCounter.current() - 1;
    }
    
    /**
     * @notice Get active listings with pagination
     * @param _offset Starting index
     * @param _limit Number of listings to return
     */
    function getActiveListings(uint256 _offset, uint256 _limit) external view returns (Listing[] memory) {
        uint256 total = activeListings.length;
        if (_offset >= total) {
            return new Listing[](0);
        }
        
        uint256 end = _offset + _limit;
        if (end > total) {
            end = total;
        }
        
        uint256 size = end - _offset;
        Listing[] memory result = new Listing[](size);
        
        for (uint256 i = 0; i < size; i++) {
            uint256 tokenId = activeListings[_offset + i];
            result[i] = listings[tokenId];
        }
        
        return result;
    }
    
    /**
     * @notice Get listings by seller
     * @param _seller Seller address
     */
    function getListingsBySeller(address _seller) external view returns (uint256[] memory) {
        uint256 count = 0;
        
        // Count seller's listings
        for (uint256 i = 0; i < activeListings.length; i++) {
            uint256 tokenId = activeListings[i];
            if (listings[tokenId].seller == _seller) {
                count++;
            }
        }
        
        // Create result array
        uint256[] memory result = new uint256[](count);
        uint256 index = 0;
        
        for (uint256 i = 0; i < activeListings.length; i++) {
            uint256 tokenId = activeListings[i];
            if (listings[tokenId].seller == _seller) {
                result[index] = tokenId;
                index++;
            }
        }
        
        return result;
    }
    
    /**
     * @notice Get all tokens owned by an address
     * @param _owner Owner address
     */
    function tokensOfOwner(address _owner) external view returns (uint256[] memory) {
        uint256 tokenCount = balanceOf(_owner);
        if (tokenCount == 0) {
            return new uint256[](0);
        }
        
        uint256[] memory result = new uint256[](tokenCount);
        uint256 index = 0;
        
        for (uint256 tokenId = 1; tokenId < _tokenIdCounter.current(); tokenId++) {
            if (_exists(tokenId) && ownerOf(tokenId) == _owner) {
                result[index] = tokenId;
                index++;
            }
        }
        
        return result;
    }
    
    /**
     * @notice Override _baseURI function
     */
    function _baseURI() internal view override returns (string memory) {
        return baseTokenURI;
    }
    
    /**
     * @notice Remove listing from active listings array
     * @param _tokenId Token ID to remove
     */
    function _removeListing(uint256 _tokenId) internal {
        require(isListed[_tokenId], "Token not listed");
        
        uint256 index = listingIndex[_tokenId];
        uint256 lastTokenId = activeListings[activeListings.length - 1];
        
        // Move last element to deleted spot
        activeListings[index] = lastTokenId;
        listingIndex[lastTokenId] = index;
        
        // Remove last element
        activeListings.pop();
        
        // Clean up mappings
        delete listings[_tokenId];
        delete isListed[_tokenId];
        delete listingIndex[_tokenId];
    }
    
    /**
     * @notice Override _beforeTokenTransfer to handle listing cleanup
     */
    function _beforeTokenTransfer(address from, address to, uint256 tokenId, uint256 batchSize) internal override {
        super._beforeTokenTransfer(from, to, tokenId, batchSize);
        
        // If token is listed and being transferred (not minting), remove listing
        if (from != address(0) && isListed[tokenId]) {
            _removeListing(tokenId);
            emit TokenUnlisted(tokenId, from);
        }
    }
    
    /**
     * @notice Get collection statistics
     */
    function getCollectionStats() external view returns (
        uint256 _totalSupply,
        uint256 _maxSupply,
        uint256 _totalRevenue,
        uint256 _totalMarketplaceFees,
        uint256 _activeListingsCount,
        uint256 _mintPrice,
        uint256 _marketplaceFeePercent
    ) {
        return (
            _tokenIdCounter.current() - 1,
            maxSupply,
            totalRevenue,
            totalMarketplaceFees,
            activeListings.length,
            mintPrice,
            marketplaceFeePercent
        );
    }
}

contracts/OrderNFTLaunch.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "./OrderNFTCollection.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

interface IERC20Burnable {
    function transferFrom(address sender, address recipient, uint256 amount) external returns (bool);
    function burn(uint256 amount) external;
    function balanceOf(address account) external view returns (uint256);
}

/**
 * @title OrderNFTLaunch
 * @notice Factory contract for creating NFT collections with marketplace functionality
 * @dev Users burn ORDER tokens to create custom NFT collections
 * Each collection supports custom ERC20 tokens for minting
 * @dev Security: ReentrancyGuard for reentrancy protection
 * @dev No pause functionality - Collection creation always available
 */
contract OrderNFTLaunch is ReentrancyGuard {
    // ORDER token address (to be burned for collection creation)
    IERC20Burnable public constant ORDER_TOKEN = IERC20Burnable(0x1BEd077195307229FcCBC719C5f2ce6416A58180);
    uint256 public burnAmount = 1_000_000 * 10**18; // 1M ORDER tokens (adjustable)
    address public constant DEAD_ADDRESS = 0x000000000000000000000000000000000000dEaD;
    
    // Factory admin
    address public admin;
    
    // Collection tracking
    address[] public allCollections;
    mapping(address => address[]) public collectionsByCreator;
    mapping(string => bool) public usedCollectionUrls; // Prevent duplicate URLs
    
    // Collection creation parameters struct
    struct CreateParams {
        string name;
        string symbol;
        string baseURI;
        uint256 maxSupply;
        address mintToken; // SafeERC20 token for minting
        uint256 mintPrice; // Price per NFT in mintToken
        uint256 marketplaceFeePercent; // Owner's marketplace fee (max 10%)
        string description;
        string collectionImageUrl;
    }
    
    // Collection info for frontend
    struct CollectionInfo {
        address collectionAddress;
        address creator;
        string name;
        string symbol;
        string baseURI;
        uint256 maxSupply;
        address mintToken;
        uint256 mintPrice;
        uint256 marketplaceFeePercent;
        uint256 createdAt;
        uint256 totalMinted;
        bool isActive;
    }
    
    mapping(address => CollectionInfo) public collectionInfo;
    
    // Events
    event CollectionCreated(
        address indexed collectionAddress,
        address indexed creator,
        string name,
        string symbol,
        string baseURI,
        uint256 maxSupply,
        address mintToken,
        uint256 mintPrice,
        uint256 marketplaceFeePercent
    );
    event BurnAmountUpdated(uint256 oldAmount, uint256 newAmount);
    event AdminTransferred(address indexed previousAdmin, address indexed newAdmin);
    event CollectionStatusUpdated(address indexed collection, bool isActive);
    
    modifier onlyAdmin() {
        require(msg.sender == admin, "Only admin");
        _;
    }
    
    modifier validCollectionAddress(address _collection) {
        require(_collection != address(0), "Invalid collection address");
        require(collectionInfo[_collection].collectionAddress != address(0), "Collection not found");
        _;
    }
    
    constructor() {
        admin = msg.sender;
    }
    
    /**
     * @notice Update burn amount for collection creation
     * @dev Only admin can change this (to adjust for ORDER token price changes)
     * @param _newBurnAmount New amount of ORDER tokens to burn (in wei)
     */
    function setBurnAmount(uint256 _newBurnAmount) external onlyAdmin {
        require(_newBurnAmount > 0, "Burn amount must be positive");
        uint256 oldAmount = burnAmount;
        burnAmount = _newBurnAmount;
        emit BurnAmountUpdated(oldAmount, _newBurnAmount);
    }
    
    /**
     * @notice Transfer admin role to a new address
     * @dev Only current admin can transfer ownership
     * @param _newAdmin Address of the new admin
     */
    function transferAdmin(address _newAdmin) external onlyAdmin {
        require(_newAdmin != address(0), "Invalid new admin");
        require(_newAdmin != admin, "Already admin");
        address previousAdmin = admin;
        admin = _newAdmin;
        emit AdminTransferred(previousAdmin, _newAdmin);
    }
    
    /**
     * @notice Create a new NFT collection
     * @dev Burns ORDER tokens from creator
     * Creates a new NFT contract with marketplace functionality
     * @param params Collection creation parameters
     */
    function createNFTCollection(CreateParams calldata params) external nonReentrant returns (address) {
        // Validate parameters
        require(bytes(params.name).length > 0 && bytes(params.name).length <= 100, "Invalid name length");
        require(bytes(params.symbol).length > 0 && bytes(params.symbol).length <= 20, "Invalid symbol length");
        require(bytes(params.baseURI).length > 0, "Base URI required");
        require(!usedCollectionUrls[params.baseURI], "Base URI already used");
        require(params.maxSupply > 0 && params.maxSupply <= 100000, "Invalid max supply");
        require(params.mintToken != address(0), "Invalid mint token");
        require(params.mintPrice > 0, "Invalid mint price");
        require(params.marketplaceFeePercent <= 1000, "Marketplace fee too high"); // Max 10%
        require(bytes(params.description).length <= 1000, "Description too long");
        
        // Verify mint token is a valid ERC20
        try IERC20(params.mintToken).totalSupply() returns (uint256) {
            // Token is valid ERC20
        } catch {
            revert("Invalid ERC20 mint token");
        }
        
        // Burn ORDER tokens (transfer to dead address)
        require(ORDER_TOKEN.transferFrom(msg.sender, DEAD_ADDRESS, burnAmount), "ORDER burn failed");
        
        // Mark URL as used
        usedCollectionUrls[params.baseURI] = true;
        
        // Deploy new NFT collection contract
        OrderNFTCollection collection = new OrderNFTCollection(
            params.name,
            params.symbol,
            params.baseURI,
            params.maxSupply,
            params.mintToken,
            params.mintPrice,
            params.marketplaceFeePercent,
            msg.sender,
            address(this)
        );
        
        address collectionAddress = address(collection);
        
        // Store collection info
        collectionInfo[collectionAddress] = CollectionInfo({
            collectionAddress: collectionAddress,
            creator: msg.sender,
            name: params.name,
            symbol: params.symbol,
            baseURI: params.baseURI,
            maxSupply: params.maxSupply,
            mintToken: params.mintToken,
            mintPrice: params.mintPrice,
            marketplaceFeePercent: params.marketplaceFeePercent,
            createdAt: block.timestamp,
            totalMinted: 0,
            isActive: true
        });
        
        allCollections.push(collectionAddress);
        collectionsByCreator[msg.sender].push(collectionAddress);
        
        emit CollectionCreated(
            collectionAddress,
            msg.sender,
            params.name,
            params.symbol,
            params.baseURI,
            params.maxSupply,
            params.mintToken,
            params.mintPrice,
            params.marketplaceFeePercent
        );
        
        return collectionAddress;
    }
    
    /**
     * @notice Update collection status (active/inactive)
     * @dev Only factory admin can change this
     * @param _collection Collection address
     * @param _isActive New status
     */
    function setCollectionStatus(address _collection, bool _isActive) external onlyAdmin validCollectionAddress(_collection) {
        collectionInfo[_collection].isActive = _isActive;
        emit CollectionStatusUpdated(_collection, _isActive);
    }
    
    /**
     * @notice Update minted count for a collection (called by collection contract)
     * @param _newMintedCount New total minted count
     */
    function updateMintedCount(uint256 _newMintedCount) external {
        require(collectionInfo[msg.sender].collectionAddress != address(0), "Only collections can call");
        collectionInfo[msg.sender].totalMinted = _newMintedCount;
    }
    
    /**
     * @notice Get total number of collections
     */
    function collectionCount() external view returns (uint256) {
        return allCollections.length;
    }
    
    /**
     * @notice Get collections created by a specific user
     */
    function getCollectionsByCreator(address _creator) external view returns (address[] memory) {
        return collectionsByCreator[_creator];
    }
    
    /**
     * @notice Get collection info by address
     */
    function getCollectionInfo(address _collection) external view returns (CollectionInfo memory) {
        return collectionInfo[_collection];
    }
    
    /**
     * @notice Get all collections (paginated)
     * @param _offset Starting index
     * @param _limit Number of collections to return
     * @param _activeOnly If true, only return active collections
     */
    function getAllNFTMarketplaces(uint256 _offset, uint256 _limit, bool _activeOnly) external view returns (CollectionInfo[] memory) {
        uint256 total = allCollections.length;
        if (_offset >= total) {
            return new CollectionInfo[](0);
        }
        
        // Count valid collections
        uint256 validCount = 0;
        for (uint256 i = _offset; i < total && validCount < _limit; i++) {
            address collectionAddr = allCollections[i];
            if (!_activeOnly || collectionInfo[collectionAddr].isActive) {
                validCount++;
            }
        }
        
        CollectionInfo[] memory result = new CollectionInfo[](validCount);
        uint256 resultIndex = 0;
        
        for (uint256 i = _offset; i < total && resultIndex < _limit; i++) {
            address collectionAddr = allCollections[i];
            CollectionInfo memory info = collectionInfo[collectionAddr];
            
            if (!_activeOnly || info.isActive) {
                result[resultIndex] = info;
                resultIndex++;
            }
        }
        
        return result;
    }
    
    /**
     * @notice Get collections with search filters
     * @param _offset Starting index
     * @param _limit Number of collections to return
     * @param _creator Filter by creator (address(0) for all)
     * @param _mintToken Filter by mint token (address(0) for all)
     * @param _activeOnly If true, only return active collections
     */
    function getFilteredCollections(
        uint256 _offset,
        uint256 _limit,
        address _creator,
        address _mintToken,
        bool _activeOnly
    ) external view returns (CollectionInfo[] memory) {
        uint256 total = allCollections.length;
        if (_offset >= total) {
            return new CollectionInfo[](0);
        }
        
        // First pass: count valid collections to determine exact array size
        uint256 validCount = 0;
        uint256 currentIndex = 0;
        
        for (uint256 i = _offset; i < total && validCount < _limit; i++) {
            address collectionAddr = allCollections[i];
            CollectionInfo memory info = collectionInfo[collectionAddr];
            
            if ((_creator == address(0) || info.creator == _creator) &&
                (_mintToken == address(0) || info.mintToken == _mintToken) &&
                (!_activeOnly || info.isActive)) {
                validCount++;
            }
        }
        
        // Create exact size array and fill it
        CollectionInfo[] memory result = new CollectionInfo[](validCount);
        uint256 resultIndex = 0;
        
        for (uint256 i = _offset; i < total && resultIndex < validCount; i++) {
            address collectionAddr = allCollections[i];
            CollectionInfo memory info = collectionInfo[collectionAddr];
            
            if ((_creator == address(0) || info.creator == _creator) &&
                (_mintToken == address(0) || info.mintToken == _mintToken) &&
                (!_activeOnly || info.isActive)) {
                result[resultIndex] = info;
                resultIndex++;
            }
        }
        
        return result;
    }
    
    /**
     * @notice Check if a collection URL is already used
     */
    function isUrlUsed(string calldata _url) external view returns (bool) {
        return usedCollectionUrls[_url];
    }
}

